import { BrowserRouter, Navigate, Route, Routes, useRoutes } from "react-router-dom";
import HomePage from "./homePage/HomePage";
import Login from "./login/Login";
import React from "react";

interface PrivateRouteProps {
  path: string;
  component: React.ComponentType;
}

function App() {
  const token = localStorage.getItem("access_token");

  const PrivateRoute: React.FC<PrivateRouteProps> = ({ path, component }) => {
    return token ? (
      <Route path={path} element={React.createElement(component)} />
    ) : (
      <Navigate to="/login" replace />
    );
  };

  const routing = useRoutes(<>
    <Routes>
      <Route path="/login" element={<Login />} />
      <PrivateRoute path="/HomePage" element={<HomePage />} />
    </Routes>
    </>
  );

  return (
    <BrowserRouter>
      {routing}
    </BrowserRouter>
  );
}

export default App;
